import React from 'react';

function NotFound() {
  return (
    <div style={{ textAlign: 'center', padding: '50px' }}>
      <h1>404 - Página não encontrada</h1>
      <p>A página que você está procurando não existe.</p>
    </div>
  );
}

export default NotFound;
